    height: 60px;
    justify-content: center;
    width: 100%;
`;

const InputWrapper = styled.div`
    border: solid;
    height: 40px;
    width: 85%;
`;




const HomeCardListInput = () => {
  return (
    <Container>
          <InputWrapper>

          </InputWrapper>   

    </Container>
  )
}

export default HomeCardListInput
